["d"] = "The cat-like people of Ramkahen are the descendants of the Tol'vir, guardians of Uldum.  Though they've lost their stone bodies, protecting the secrets of the titans is still a part of their rigid tradition.",
["w"] = false,
["n"] = "Ramkahen",
},
{
["i"] = true,
["r"] = false,
["d"] = "An airborne military force created by Shattrath City to deal with the threats that loom in the highest reaches of Outland.",
["w"] = false,
["n"] = "Sha'tari Skyguard",
},
{
["i"] = true,
["r"] = false,
["d"] = "The shadowy protectors of Pandaria's temples, the Shado-Pan are wrought with mystery.",
["w"] = false,
["n"] = "Shado-Pan",
},
{
["i"] = true,
["r"] = false,
["d"] = "These valorous Shado-Pan venture into the Throne of Thunder to vanquish the evil found within, and exact justice for the centuries of slavery they endured under the Thunder King's reign.",
["w"] = false,
["n"] = "Shado-Pan Assault",
},
{
["i"] = true,
["r"] = false,
["d"] = "The sporelings are a mostly peaceful race of mushroom-men native to Outland. Their home is located in the southern bogs of Zangarmarsh. ",
["w"] = true,
["n"] = "Sporeggar",
},
{
["i"] = true,
["r"] = false,
["d"] = "The goblins of the Steamwheedle Preservation Society seek to liberate relics from the ogres of Nagrand with the noble intention of selling them to the highest bidder.",
["w"] = false,
["n"] = "Steamwheedle Preservation Society",
},
{
["i"] = true,
["r"] = false,
["d"] = "Under a pact by Tirion Fordring and Darion Mograine, the Argent Crusade and the Knights of the Ebon Blade have set aside their differences during the attack on Icecrown Citadel until the Lich King is slain.",
["w"] = false,
["n"] = "The Ashen Verdict",
},
{
["i"] = true,
["r"] = false,
["d"] = "These brave Pandaren defend the temples of Pandaria from the evils of the Sha.",
["w"] = false,
["n"] = "The August Celestials",
},
{
["i"] = true,
["r"] = false,
["d"] = "Black Prince Wrathion is the last of the black dragons. He has been known to richly reward those who earn his trust and support his endeavors.",
["w"] = false,
["n"] = "The Black Prince",
},
{
["i"] = true,
["r"] = false,
["d"] = "This gathering of the most powerful shaman of Azeroth seeks to maintain the balance between the world's elemental forces.  Their main focus during the cataclysm has been to  repair and stabilize the damage caused by Deathwing's arrival.",
["w"] = false,
["n"] = "The Earthen Ring",
},
{
["i"] = true,
["r"] = false,
["d"] = "This mysterious race of frost dwarves makes their home in the Storm Peaks.  They've recently befriended members of the Explorers' League and welcome Alliance members within their settlements.",
["w"] = false,
["n"] = "The Frostborn",
},
{
["i"] = true,
["r"] = false,
["d"] = "The tuskarr are a tough but peaceful people who derive their livelihood from fishing and whaling.  Their settlements have recently come under fierce attack and welcome any allies who would come to their aid.",
["w"] = false,
["n"] = "The Kalu'ak",
},
{
["i"] = true,
["r"] = false,
["d"] = "These Mantid Elders are untouched by the corruption and insanity that has overtaken the remainder of the Mantid Swarm. They seek to work with the races of Pandaria to restore their Queen to glory.",
["w"] = false,
["n"] = "The Klaxxi",
},
{
["i"] = true,
["r"] = false,
["d"] = "Caretakers of the mysteries of Pandaria, these brave souls roam the continent, hoping to learn from their history.",
["w"] = false,
["n"] = "The Lorewalkers",
},
{
["i"] = true,
["r"] = false,
["d"] = "The treacherous wilds of Tanaan Jungle have attracted the craftiest hunters from both Azeroth and Draenor. To defeat the beasts of Tanaan, one must become a beast.",
["w"] = false,
["n"] = "The Saberstalkers",
},
{
["i"] = true,
["r"] = false,
["d"] = "A militant core of high elves that rejects the admission of blood elves into the Kirin Tor.  They've united under the banner of Vereesa Windrunner and joined the Alliance forces in Northrend.",
["w"] = false,
["n"] = "The Silver Covenant",
},
{
["i"] = true,
["r"] = false,
["d"] = "The frost giants of the Storm Peaks are a war-like race that makes their home in Dun Niffelem.",
["w"] = true,
["n"] = "The Sons of Hodir",
},
{
["i"] = true,
["r"] = false,
["d"] = "A secret sect of the Kirin Tor founded to spy on Medivh and his activities.",
["w"] = false,
["n"] = "The Violet Eye",
},
{
["i"] = true,
["r"] = false,
["d"] = "With the Blue Dragonflight's violent upheaval against all mortal users of magic, the remaining dragonflights have banded under the leadership of the Red Dragonflight to combat their wayward kin.",
["w"] = false,
["n"] = "The Wyrmrest Accord",
},
{
["i"] = true,
["r"] = false,
["d"] = "The elemental plane of earth, Deepholm, is ruled by Therazane and her children, the Stone Lords.  After witnessing the devastation Deathwing and his followers caused her realm, Therazane treats all outsiders with open hostility.",
["w"] = true,
["n"] = "Therazane",
},
{
["i"] = true,
["r"] = false,
["d"] = "The main armies of the Alliance in Northrend, moving against the Scourge and unified under King Varian Wrynn's command.",
["w"] = false,
["n"] = "Valiance Expedition",
},
{
["i"] = true,
["r"] = false,
["d"] = "The Wildhammer dwarves are known for their near-reckless courage as well as their unsurpassed gryphon-riding skills.  After losing their home of Grim Batol to a Dark Iron Curse, they've spread their dwellings around the Twilight Highlands.",
["w"] = false,
["n"] = "Wildhammer Clan",
},
{
